import React from 'react'

const Todos = (props) => {
    console.log(props.list);
    const displayList = props.list.map(x=>{
        return(
            <ul className="collection" key={x.id}>
                <li className="collection-item">{x.todo}</li>
            </ul>
        )
    })

    return (
        <div>

            {displayList}
        </div>
    )
}

export default Todos
